'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendClientMessageCommand extends SendSingleCommandWithoutResponse {
    sendClientMessageRequest;
    constructor() {
        super();
        this.commandName = "SendClientMessageCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createSendMailMessage(this.tradingSession, this.sendClientMessageRequest, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = SendClientMessageCommand
